<script setup>
import { useProductsStore } from '~/stores/productsStore'
import { useUtils } from '~/composables/useUtils';

//store 
const { filterProductsByType } = useProductsStore()
const { scrollTo } = useUtils();

//data
const filters = ref([
  {
    name: "hoodie",
    value: false,
    subFilters: ['light','cup holders','cotton']
  },
  {
    name: "jaket",
    value: false,
    subFilters: ['jeans','leather','Kawi']
  },
  {
    name: "hijab",
    value: false,
    subFilters: ['Char3i','Jilbab','Long slaves']
  },
  {
    name: "shoes",
    value: false,
    subFilters: ['sport','Low','high','Original']
  },
  {
    name: "pants",
    value: false,
    subFilters: ['jeans','cargo','latwal']
  },
  {
    name: "scarfs",
    value: false,
    subFilters: ['long','underKhimar','water resistance']
  },
]);

const productContainer = ref(null)

//hooks
onMounted(()=> {
  productContainer.value = document.querySelector('#products-main-container')
})

//functions
const openList = (filter) => {
  filters.value.forEach((fil) => {
    if (filter === fil.name) {
      fil.value = !fil.value
    } else {
      fil.value = false
    }
  })

  filterProductsByType(filter)
  scrollTo(productContainer.value)
};
</script>

